import React from 'react';
import { NavLink } from 'react-router-dom';
import './nav.css';
import logo from '../../assets/logo.svg';
const Nav = (props) => {
	const url = props;
	console.log(url);

	return (
		<div className="navContainer">
			<img className="pointer" src={logo} />

			<NavLink to="/"> Link</NavLink>
		</div>
	);
};

export default Nav;
